INSERT INTO `Offerta` (`OffertaId`, `tipoOfferta`, `descrizione`) VALUES
(1, 'Sconto Fisso', 'Porto ecco ricerca voltare stesso fatto però caso nazione scherzare questione nudo attenzione ottenere proporre.'),
(2, 'Promo Speciale', 'Nord sera macchina momento vivere elettrico perché interesse scusare formare minore.'),
(3, 'Promo Speciale', 'Distruggere sapere troppo riunire roba sorgere mangiare.'),
(4, 'Sconto Fisso', 'Segretario signorina finalmente diritto dio appoggiare nostro.'),
(5, 'Percentuale', 'Sorprendere sociale tardi aspetto direzione rompere spalla alto stupido contadino grazie lato.'),
(6, 'Promo Speciale', 'Popolazione pane confronto argomento infatti passo minore forma attorno evitare capire fabbrica primo scrivere determinare valere.'),
(7, 'Sconto Fisso', 'Indietro notare mondo secolo grosso entro milione meno possibilità partecipare.'),
(8, 'Sconto Fisso', 'Bisognare interno filo elettrico papà cantare provvedere.'),
(9, 'Promo Speciale', 'Finire attaccare brutto lanciare tale carattere sapere libro lo fratello non tuo giugno cattolico posare interesse.'),
(10, 'Sconto Fisso', 'Dividere diretto nulla questione articolo ascoltare pietà importante perfino salvare.'),
(11, 'Promo Speciale', 'Insegnare ricordare forte mentre opinione felice specie matrimonio speciale.'),
(12, 'Percentuale', 'Zio distinguere pronto guidare qualsiasi possibile odore bestia possibile riempire titolo dopo secondo popolo sacrificio cercare.'),
(13, 'Percentuale', 'Che orecchio ponte chiudere assicurare villa vuoto.'),
(14, 'Promo Speciale', 'Partecipare rivoluzione ragione straniero spesa fenomeno spazio innamorare verso.'),
(15, 'Promo Speciale', 'Finire folla prova perché monte carta vista.'),
(16, 'Percentuale', 'Voglia costituire proposito insegnare termine inglese tanto medesimo nave riferire necessario lingua.'),
(17, 'Percentuale', 'Cane autore ascoltare preferire trarre servizio elettrico nazione discorso niente arma.'),
(18, 'Percentuale', 'Pietà biondo moderno abito spettacolo qualche classe università improvviso pomeriggio forte possibilità concludere perché proposito offrire.'),
(19, 'Percentuale', 'Medesimo serie alzare straniero storia pronto padrone differenza diventare di domenica conoscenza inglese normale bestia.'),
(20, 'Percentuale', 'Oltre odore spettacolo acqua scuola domanda energia autorità pianta sociale.'),
(21, 'Sconto Fisso', 'Solo volgere assicurare potere dire grazia simile momento distanza personaggio riconoscere oppure riuscire certo sonno.'),
(22, 'Promo Speciale', 'Profondo ordinare società accendere bianco appunto direzione metà qua abbastanza trarre sì spalla origine epoca giugno.'),
(23, 'Promo Speciale', 'Secondo tale entro origine pelle limite ordine campagna lato.'),
(24, 'Sconto Fisso', 'Cercare parere grosso volare gesto dottore prossimo comprare palazzo favore fuori anno affrontare dentro là.'),
(25, 'Percentuale', 'Speranza tendere tale ordine zona pesare lavoro rifiutare nulla essere controllo naturale.'),
(26, 'Percentuale', 'Offrire eppure fantasia significare con posizione contare essa buttare zitto spesa importanza preferire.'),
